"original": |2-
     Key wrapping with SEED is identical to Section 2.2.1 of [RFC3394]
     with "AES" replaced by "SEED".  The algorithm is specified in
     [RFC4010].  The implementation of SEED is optional.  The default
     initial value is 0xA6A6A6A6A6A6A6A6.
"fixed": |-
  Key wrapping with SEED is identical to Section 2.2.1 of [RFC3394] with "AES" replaced by "SEED".  The algorithm is specified in [RFC4010].  The implementation of SEED is optional.  The default initial value is 0xA6A6A6A6A6A6A6A6.
"ko": |-
  SEED를 사용한 키 래핑은 "AES"가 "SEED"로 대체된 [RFC3394]의 섹션 2.2.1과 동일합니다. 알고리즘은 [RFC4010]에 지정되어 있습니다. SEED 구현은 선택 사항입니다. 기본 초기 값은 0xA6A6A6A6A6A6A6A6입니다.
